import React from 'react';


const MyNews = ({articles}) => {



    return (
        <div className="container">
        <h2>Latest News API</h2>



        <div className="row">


        {
                articles.map((curElem) => {
                //const { date, title, url, image, desc, author, id, name, cont  } = curElem;

            return (

                    <div className='col-12 col-md-4 col-lg-3 mb-4' key={curElem.id}>  
                    <div className="card-group">
                      <div className="card" >
                        <img className='img-fluid' src={curElem.image} alt='Image' />
                        <div className="card-body">
                          <h4 className="card-title">{curElem.title}</h4>   
                          <small>{curElem.date}</small> 
                          <small>{curElem.name}</small> 
                          <p className="card-text">{curElem.desc}</p>
                          <p className="card-text">{curElem.cont}</p> 
                           <a className="btn btn-secondary btn-sm" target="_blank" href={curElem.url}>Read More </a>
                        </div>
                      <div className="card-footer">
                        <small className="text-muted"><strong>Author</strong>{curElem.author}</small>
                      </div>
                    </div>  
                    </div>
                    </div>


            )
            })        

            }  
           </div>
       </div>
    )
}

export default MyNews;
